export default class NodeClass {
    constructor(name, fields, methods, width, height){
        this.name = name;
        this.fields = fields;
        this.methods = methods;
        this.width = width;
        this.height = height;
        self.x = 0;
        self.y = 0;
    }

    toString(){
        return this.name;
    }
}
